import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, IconButton, Typography, Button, Paper, Grid } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import '../style/HomeBis.css';

function HomeBis() {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', height: '100vh' }}>
      <AppBar position="static" color="inherit" elevation={0}>
        <Toolbar>
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
            <IconButton edge="start" color="inherit" aria-label="home">
              <HomeIcon />
            </IconButton>
          </Link>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            {/* This makes sure the "Contact" button is pushed to the far right */}
          </Typography>
          <Link to="/Contact" style={{ textDecoration: 'none', color: 'inherit' }}>
            <Button color="inherit">Contact</Button>
          </Link>
        </Toolbar>
      </AppBar>

      <div style={{ flexGrow: 1 }}></div> {/* This div will push the grid to the bottom */}

      <Grid container spacing={3}> {/* Increased spacing for more margin between grid items */}
        {[1, 2, 3].map((item) => (
          <Grid item xs={4} key={item}>
            <Paper elevation={0} style={{ height: 'calc(0.5 * (100vh - 64px))', background: '#F4F3F1', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
              <Paper elevation={8} style={{ width: '50%', height: '50%', background: '#EFEFEF' }} /> {/* Decreased size of the inner papers */}
            </Paper>
          </Grid>
        ))}
      </Grid>
    </div>
  );
}

export default HomeBis;
